        System.out.println(solve(new String[]{"90.0", "6.0", "8.0"}));
    }

    public static int solve(String[] N_0_N_1_N_2) {
        List<Double> arr = Arrays.asList(N_0_N_1_N_2);
        arr.sort(Comparator.reverseOrder());
        int min = 0;
        for (int i = 0; i < arr.size(); i++) {
            min = Math.min(min, arr.get(i));
        }
        return min;
    }
}
